import React from "react";

const Country = ({data}) => {

    const filteredCountries = data.map(country => country);

    return <div>
        <h1>{filteredCountries.name}</h1>
        <p>{filteredCountries.capital}</p>
        <p>area {filteredCountries.area}</p>
    </div>
}

export default Country;
